<ul>
<li>Awarded the title of Associate Professor</li>
<li>Graduated with a Doctor of Medicine degree</li>
<li>Graduated from Specialty Doctor II</li>
<li>Was conferred the title of People\`s Doctor</li>
<li>Deputy Director of Thu Cuc International General Hospital</li>
</ul>
<h2>Examination and treatment</h2>
<p><strong>cardiovascular disease</strong></p>
<ul>
<li>Fast heart rate and low blood pressure</li>
<li>In-depth examination, consultation and treatment of cardiovascular diseases</li>
<li>Cardiovascular diseases</li>
<li>Cardiac arrhythmias: Tachycardia, bradycardia, erratic heart rate changes</li>
<li>Heart attack</li>
<li>Counseling, early detection and prevention of cardiovascular diseases</li>
<li>Counseling on the use of anticoagulants</li>
</ul>
<p><strong>Coronary artery disease</strong></p>
<ul>
<li>Coronary artery disease</li>
<li>Coronary artery disease</li>
<li>Coronary insufficiency</li>
<li>Atherosclerosis</li>
<li>Treatment of coronary heart disease</li>
</ul>
<p>Symptoms of coronary heart disease:_</p>
<p>Chest pain is one of the most common symptoms
Pain in the middle of the chest, behind the sternum or in the front of the heart</p>
<ul>
<li>Pain may radiate to the neck, jaw, arm, most commonly the left side, sometimes pain in the epigastrium</li>
<li>Feelings of constriction, suffocation, pressure
-Sometimes it\`s just an uncomfortable feeling in the chest</li>
<li>There are cases that spread to the back, the spine area</li>
</ul>
<p><strong>Dyslipidemia</strong></p>
<ul>
<li>High blood lipid disease</li>
<li>Counseling and treatment of blood lipids</li>
<li>Dyslipidemia</li>
<li>Metabolic disorder</li>
