<li>Rythme cardiaque rapide et pression artérielle basse</li>
<li>Examen approfondi, consultation et traitement des maladies cardiovasculaires</li>
<li>Maladies cardiovasculaires</li>
<li>Arythmies cardiaques : tachycardie, bradycardie, modifications erratiques de la fréquence cardiaque</li>
