<li>Athérosclérose</li>
<li>Traitement des maladies coronariennes</li>
</ul>
<p>Symptômes de la maladie coronarienne :_</p>
<p>La douleur thoracique est l\`un des symptômes les plus courants
Douleur au milieu de la poitrine, derrière le sternum ou devant le cœur</p>
<ul>
<li>La douleur peut irradier vers le cou, la mâchoire, le bras, le plus souvent vers le côté gauche, parfois une douleur dans l\`épigastre.</li>
