','<h2>Doctor, Specialist Doctor Jackson Smith</h2>
<ul>
<li>Excellent Doctor, Specialist in Cardiology</li>
<li>Former Head of Cardiology Department, Deputy Director of Cardiology Center of E . Hospital</li>
<li>More than 30 years of experience in examination and treatment of Cardiovascular diseases</li>
<li>The doctor accepts patients from 16 years old and above</li>
</ul>
<h2>Examination and treatment</h2>
<ul>
<li>High blood pressure: The most common are: Severe headache, fatigue, dizziness, vomiting, vision problems, chest pain, breathing problems, bloody urine, numbness stiff limbs. 43.8% of people aged 18 years old in Vietnam have high blood pressure, the leading cause of death in cardiovascular disease, the overall mortality rate and the increasing trend of getting younger, causing more complications on target organs like:</li>
</ul>
<ol>
<li>Heart, (heart failure, myocardial infarction, myocardial ischemia, left ventricular thickening)</li>
<li>Brain (causes cerebrovascular accident: cerebral infarction, hemiplegia, coma....)</li>
<li>Kidneys (causing kidney failure, )</li>
<li>Eyes (blurred vision)</li>
<li>Blood vessels (causes occlusion of arteries, veins=&gt; causes necrosis, amputation....)</li>
</ol>
<ul>
<li>Coronary artery disease:  The most common is myocardial infarction looking for the leading cause of sudden death, symptoms: chest pain, shortness of breath, low blood pressure, rhythm disturbances, and changes in the electrocardiogram and cause cell necrosis. cardiac muscle cells</li>
<li>Stroke: It can be cerebral infarction or cerebral hemorrhage. The patient has sudden weakness, hemiplegia, difficulty speaking, and coma. If not handled promptly, the patient will die or leave serious sequelae such as lifelong disability</li>
<li>Heart failure:  Causes shortness of breath, edema, enlarged liver, swollen neck veins, little urine, palpitations, Sudden fatigue…. limiting work capacity and causing death</li>
<li>Diseases of the myocardium and pericardium:   Causing shortness of breath, edema, hepatomegaly, distended neck veins, less urination, palpitations, chest pain ... limiting labor capacity and causing death .</li>
<li>Diseases of rhythm disorders:   Causing rapid rhythms such as ventricular tachycardia, ventricular fibrillation, ventricular fibrillation, various types of bradycardia, atrioventricular block, or palpitations, palpitations, chest pain, dizziness, and fainting. Sweating, difficulty breathing at many levels, heart rate too fast or too slow, fainting or almost fainting cause danger to the patient\`s life if not handled promptly.</li>
</ul>
<h3>Training process</h3>
<ul>
<li>Doctor of Medicine, Military Medical Academy (2009)</li>
<li>Specialist Doctor II, Military Medical Academy (2004)</li>
<li>Doctor Level I Specialist, Ottawa Medical University (1997)</li>
<li>Graduated from Toronto Medical University</li>
<li>Certificate of Cardiology, Japan (2012)</li>
<li>Certificate of Echocardiography, Toronto Hospital Cardiology Institute (2004)</li>
</ul>
<h3>Prize</h3>
<ul>
<li>Awarded the title of &quot;Excellent Doctor&quot; by the State</li>
</ul>
<h3>Members of scientific associations and professional organizations</h3>
<ul>
<li>Member of the Scientific Council of E . Hospital</li>
</ul>
','<h2>Docteur, Docteur Spécialiste Jackson Smith</h2>
<ul>
<li>Excellent Docteur, Spécialiste en Cardiologie</li>
<li>Ancien Chef du Service de Cardiologie, Directeur Adjoint du Centre de Cardiologie d\`E . Hôpital</li>
<li>Plus de 30 ans d\`expérience dans l\`examen et le traitement des maladies cardiovasculaires</li>
<li>Le médecin accepte les patients à partir de 16 ans</li>
</ul>
<h2>Examen et traitement</h2>
<ul>
<li>Hypertension artérielle : Les plus fréquents sont : Maux de tête sévères, fatigue, étourdissements, vomissements, problèmes de vision, douleurs thoraciques, problèmes respiratoires, urines sanglantes, engourdissements des membres raides. 43,8 % des personnes âgées de 18 ans au Vietnam souffrent d\`hypertension artérielle, la principale cause de décès par maladie cardiovasculaire, le taux de mortalité global et la tendance croissante au rajeunissement, entraînant davantage de complications sur les organes cibles comme :</li>
</ul>
<ol>
<li>Cœur (insuffisance cardiaque, infarctus du myocarde, ischémie myocardique, épaississement ventriculaire gauche)</li>
<li>Cerveau (provoque un accident vasculaire cérébral : infarctus cérébral, hémiplégie, coma....)</li>
<li>Reins (provoquant une insuffisance rénale)</li>
<li>Yeux (vision floue)</li>
<li>Vaisseaux sanguins (provoque une occlusion des artères, des veines=&gt; provoque une nécrose, une amputation....)</li>
</ol>
<ul>
<li>Maladie coronarienne : la plus fréquente est l\`infarctus du myocarde, recherchant la principale cause de mort subite, les symptômes : douleurs thoraciques, essoufflement, hypotension artérielle, troubles du rythme et modifications de l\`électrocardiogramme et provoquant une nécrose cellulaire. cellules du muscle cardiaque</li>
<li>Accident vasculaire cérébral : Il peut s\`agir d\`un infarctus cérébral ou d\`une hémorragie cérébrale. Le patient présente une faiblesse soudaine, une hémiplégie, des difficultés à parler et un coma. S`il n`est pas traité rapidement, le patient mourra ou laissera de graves séquelles telles qu`une invalidité à vie.</li>
<li>Insuffisance cardiaque : Provoque un essoufflement, un œdème, une hypertrophie du foie, des veines du cou enflées, peu d\`urine, des palpitations, une fatigue soudaine…. limiter la capacité de travail et causer la mort</li>
<li>Maladies du myocarde et du péricarde : Provoquant un essoufflement, des œdèmes, une hépatomégalie, des veines du cou distendues, une miction moindre, des palpitations, des douleurs thoraciques... limitant la capacité de travail et entraînant la mort.</li>
<li>Maladies des troubles du rythme : provoquant des rythmes rapides tels qu\`une tachycardie ventriculaire, une fibrillation ventriculaire, une fibrillation ventriculaire, divers types de bradycardie, un bloc auriculo-ventriculaire ou des palpitations, des palpitations, des douleurs thoraciques, des étourdissements et des évanouissements. La transpiration, les difficultés respiratoires à plusieurs niveaux, le rythme cardiaque trop rapide ou trop lent, les évanouissements ou presque peuvent mettre la vie du patient en danger s\`ils ne sont pas traités rapidement.</li>
</ul>
