- Stroke: It can be cerebral infarction or cerebral hemorrhage. The patient has sudden weakness, hemiplegia, difficulty speaking, and coma. If not handled promptly, the patient will die or leave serious sequelae such as lifelong disability
- Heart failure:  Causes shortness of breath, edema, enlarged liver, swollen neck veins, little urine, palpitations, Sudden fatigue…. limiting work capacity and causing death
- Diseases of the myocardium and pericardium:   Causing shortness of breath, edema, hepatomegaly, distended neck veins, less urination, palpitations, chest pain ... limiting labor capacity and causing death .
- Diseases of rhythm disorders:   Causing rapid rhythms such as ventricular tachycardia, ventricular fibrillation, ventricular fibrillation, various types of bradycardia, atrioventricular block, or palpitations, palpitations, chest pain, dizziness, and fainting. Sweating, difficulty breathing at many levels, heart rate too fast or too slow, fainting or almost fainting cause danger to the patient\`s life if not handled promptly.

