## Examen et traitement

- Hypertension artérielle : Les plus fréquents sont : Maux de tête sévères, fatigue, étourdissements, vomissements, problèmes de vision, douleurs thoraciques, problèmes respiratoires, urines sanglantes, engourdissements des membres raides. 43,8 % des personnes âgées de 18 ans au Vietnam souffrent d\`hypertension artérielle, la principale cause de décès par maladie cardiovasculaire, le taux de mortalité global et la tendance croissante au rajeunissement, entraînant davantage de complications sur les organes cibles comme :

1. Cœur (insuffisance cardiaque, infarctus du myocarde, ischémie myocardique, épaississement ventriculaire gauche)
2. Cerveau (provoque un accident vasculaire cérébral : infarctus cérébral, hémiplégie, coma....)
3. Reins (provoquant une insuffisance rénale)
4. Yeux (vision floue)
5. Vaisseaux sanguins (provoque une occlusion des artères, des veines=> provoque une nécrose, une amputation....)

- Maladie coronarienne : la plus fréquente est l\`infarctus du myocarde, recherchant la principale cause de mort subite, les symptômes : douleurs thoraciques, essoufflement, hypotension artérielle, troubles du rythme et modifications de l\`électrocardiogramme et provoquant une nécrose cellulaire. cellules du muscle cardiaque
- Accident vasculaire cérébral : Il peut s\`agir d\`un infarctus cérébral ou d\`une hémorragie cérébrale. Le patient présente une faiblesse soudaine, une hémiplégie, des difficultés à parler et un coma. S`il n`est pas traité rapidement, le patient mourra ou laissera de graves séquelles telles qu`une invalidité à vie.
- Insuffisance cardiaque : Provoque un essoufflement, un œdème, une hypertrophie du foie, des veines du cou enflées, peu d\`urine, des palpitations, une fatigue soudaine…. limiter la capacité de travail et causer la mort
- Maladies du myocarde et du péricarde : Provoquant un essoufflement, des œdèmes, une hépatomégalie, des veines du cou distendues, une miction moindre, des palpitations, des douleurs thoraciques... limitant la capacité de travail et entraînant la mort.
- Maladies des troubles du rythme : provoquant des rythmes rapides tels qu\`une tachycardie ventriculaire, une fibrillation ventriculaire, une fibrillation ventriculaire, divers types de bradycardie, un bloc auriculo-ventriculaire ou des palpitations, des palpitations, des douleurs thoraciques, des étourdissements et des évanouissements. La transpiration, les difficultés respiratoires à plusieurs niveaux, le rythme cardiaque trop rapide ou trop lent, les évanouissements ou presque peuvent mettre la vie du patient en danger s\`ils ne sont pas traités rapidement.

